er and main website navigation buttons are at the top of the LightWord theme, just like the rest of my site. In other words, I want my custom-design "Nick Carver Photography" header image, the "Gallery", "Teaching", "About", "Contact" and "Blog" buttons to all be at the top of my blog so that when users click on my blog, they don\'t feel like they\'ve left the main website. </p>\n<p>So is there a way to insert the HTML coding (shown below) into the LightWord theme so that it replaces the default header?</p>\n<p><em>[Code moderated as per the <a href="http://codex.wordpress.org/Forum_Welcome#Posting_Code">Forum Rules</a>. Please use the <a href="http://wordpress.pastebin.com/">pastebin</a>]</em>\n</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"nickcarver";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:30:"\n			\n			\n			\n			\n			\n			\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"cheezelx on "[Theme: LightWord] removing menu items from the right"";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:98:"http://wordpress.org/support/topic/theme-lightword-removing-menu-items-from-the-right#post-2402617";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 20 Oct 2011 04:08:19 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:37:"2402617@http://wordpress.org/support/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explici