s/2011/12/sonny/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:49:"http://wordpress.org/news/2011/12/sonny/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 12 Dec 2011 22:58:50 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:8:"Releases";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2135";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:382:"The latest and greatest version of the WordPress software &#8212; 3.3, named &#8220;Sonny&#8221; in honor of the great jazz saxophonist Sonny Stitt &#8212; is immediately available for download or update inside your WordPress dashboard. WordPress has had over 65 million downloads since version 3.0 was released, and in this third major iteration we&#8217;ve added significant [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"Matt Mullenweg";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:17036:"<p>The latest and greatest version of the WordPress software &#8212; 3.3, named &#8220;Sonny&#8221; in honor of the great jazz saxophonist Sonny Stitt &#8212; is <a href="http://wordpress.org/download/">immediately available for download</a> or update inside your WordPress dashboard.</p>\n<p>WordPress has had over 65 million downloads since version 3.0 was released, and in this third major iteration we&#8217;ve added significant polish around the new user experience, navigation, uploading, and imports. Check out this short video that summarizes the things we think you&#8217;ll find are the cat&#8217;s pajamas:</p>\n<div id="v-I7NAw9Zk-1" class="video-player"><embed id="v-I7NAw9Zk-1-video" src="http://s0.videopress.com/player.swf?v=1.03&amp;guid=I7NAw9Zk&amp;isDynamicSeeking=true" type="application/x-shockwave-flash" width="692" height="388" title="Introducing WordPress 3.3 &quot;Sonny&quot;" wmode="direct" seamlesstabbing="true" allowfullscreen="true" allowscriptaccess="always" overstretch="true"></embed></div>\n<h3>For Users</h3>\n<p>Experienced users will appreciate the new <strong>drag-and-drop uploader</strong>, hover menus for the navigation, the new toolbar, improved co-editing support, and the new Tumblr importer. We&#8217;ve also been thinking a ton about what the WordPress experience is like for people completely new to the software. Version 3.3 has significant improvements there with<strong>Â pointer tips</strong> for new features included in each update, a friendly welcome message for first-time users, and revamped help tabs throughout the interface. Finally we&#8217;ve improved the dashboard experience on the iPad and other tablets with better touch support.</p>\n<h3>For Developers</h3>\n<p>There is a ton of candy for developers as well. I&#8217;d recommend starting your exploration with the <a href="http://codex.wordpress.org/Function_Reference/wp_editor">new editor API</a>, new jQuery version, better ways to hook into the help screens, more performant post-slug-only permalinks, and of course the entire list of improvements <a href="http://codex.wordpress.org/Version_3.3">on the Codex</a> and <a href="http://core.trac.wordpress.org/milestone/3.3">in Trac</a>.</p>\n<h3>Roll the Credits</h3>\n<p>The Credits tab on the new About WordPress screen in the WordPress dashboard provides recognition for contributors to each release, but we like to thank them here as well.</p>\n<p><a href="http://profiles.wordpress.org/users/aaroncampbell">Aaron D. Campbell</a>, <a href="http://profiles.wordpress.org/users/jorbin">Aaron Jorbin</a>, <a href="http://profiles.wordpress.org/users/adambackstrom">Adam Backstrom</a>, <a href="http://profiles.wordpress.org/users/kawauso">Adam Harley</a>, <a href="http://profiles.wordpress.org/users/xknown">Alex Concha</a>, <a href="http://profiles.wordpress.org/users/alexkingorg">Alex King</a>, <a href="http://profiles.wordpress.org/users/viper007bond">Alex Mills (Viper007Bond)</a>, <a href="http://profiles.wordpress.org/users/amereservant">amereservant</a>, <a href="http://profiles.wordpress.org/users/ampt">ampt</a>, <a href="http://profiles.wordpress.org/users/lordandrei">Andrei Freeman</a>, <a href="http://profiles.wordpress.org/users/arena">Andre Renaut</a>, <a href="http://profiles.wordpress.org/users/andrewfrazier">andrewfrazier</a>, <a href="http://profiles.wordpress.org/users/nacin">Andrew Nacin</a>, <a href="http://profiles.wordpress.org/users/azaozz">Andrew Ozz</a>, <a href="http://profiles.wordpress.org/users/andrewryno">Andrew Ryno</a>, <a href="http://profiles.wordpress.org/users/andy">Andy Skelton</a>, <a href="http://profiles.wordpress.org/users/lumination">Anthony Atkinson</a>, <a href="http://profiles.wordpress.org/users/filosofo">Austin Matzko</a>, <a href="http://profiles.wordpress.org/users/simek">Bartosz Kaszubowski</a>, <a href="http://profiles.wordpress.org/users/benbalter">Benjamin J. Balter</a>, <a href="http://profiles.wordpress.org/users/brandondove">Brandon Dove</a>, <a href="http://profiles.wordpress.org/users/carlospaulino">carlospaulino</a>, <a href="http://profiles.wordpress.org/users/caspie">Caspie</a>, <a href="http://profiles.wordpress.org/users/cebradesign">cebradesign</a>, <a href="http://profiles.wordpress.org/users/chexee">Chelsea Otakan</a>, <a href="http://profiles.wordpress