ing and fixed several glitches Finished the Pointers implementation Landed the dashboard Welcome box for new installs Improved contextual help styling Tweaked the admin bar a little more Fixed a bunch of bugs Consult the full change log Â for [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Ryan Boren";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:917:"<p>Changes since Beta 1:</p>\n<ul>\n<li>Updated the Blue theme</li>\n<li>Fixed IE7 and RTL support</li>\n<li>Improved flyout menu styling and fixed several glitches</li>\n<li>Finished the Pointers implementation</li>\n<li>Landed the dashboard Welcome box for new installs</li>\n<li>Improved contextual help styling</li>\n<li>Tweaked the admin bar a little more</li>\n<li>Fixed a bunch of bugs</li>\n</ul>\n<p>Consult the <a href="http://core.trac.wordpress.org/log/trunk/?action=stop_on_copy&amp;mode=stop_on_copy&amp;rev=&amp;stop_rev=18939&amp;limit=100">full change log</a> Â for details, and see the <a href="http://wordpress.org/news/2011/10/wordpress-3-3-beta-1/">Beta 1 announcement</a> for information on how to help test Beta 2.</p>\n<blockquote><p>Welcome for the new &#8211;<br />\n3.3 at beta 2.<br />\n(IE7, woo!)</p></blockquote>\n<p>Download <a href="http://wordpress.org/wordpress-3.3-beta2.zip">3.3 Beta 2</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:60:"http://wordpress.org/news/2011/10/wordpress-3-3-beta-2/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1: