";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1509:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/admin-bar-backend-search/"><strong>Admin Bar Backend Search</strong></a> provides various search forms in the Dashboard.</p>\n<p><a href="http://tempspace.net/plugins/?page_id=74"><strong>WP-ImageZoom</strong></a> enables you to view details of large images.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://www.fastsecurecontactform.com/"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href="http://www.foxy-press.com/"><strong>FoxyPress</strong></a> is a custom plugin made to integrate FoxyCart e-commerce functionality into your WordPress website.</p>\n<p><a href="http://wordpress.org/extend/plugins/scripts-n-styles/"><strong>Scripts n Styles</strong></a> allows Admin users the ability to add custom CSS (at the bottom of the head tag) and JavaScript (at the bottom of the body tag) directly into individual Post, Pages or any other registered custom post types.</p>\n<p><a href="http://yoast.com/wordpress/seo/"><strong>WordPress SEO</strong></a> is an all in one solution to search engine optimize your WordPress blog: SEO titles, meta descriptions, XML sitemaps and much more.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/S6sieZO-cUU" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 13 Dec 2011 14:00:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:50:"WPTavern: Merry Christmas: WordPress 3.3. Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5977";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:100:"http://feedproxy.google.com/~r/WordpressTavern/~3/I0AIguisHyg/merry-christmas-wordpress-3-3-released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1490:"<p>The time has finally arrived. <a href="http://wordpress.org/news/2011/12/sonny/">WordPress 3.3. was released early this morning</a> to the masses. Codenamed &#8216;Sonny&#8217; which at a glance looks like sorry, 3.3 has a couple of great user oriented features with a ton of polish. While my WordPress upgrade experience went smoothly, I was immediately impressed with the welcome screen which in my opinion, is better at explaining new features in WordPress than most of the official release posts on the WordPress.org blog, minus the ones with published videos. Kudos goes out to all involved for the welcome screen as well as every other improvement that made it into WordPress 3.3. Let me know in the comments what you think of the new user experience polish that made it into this version.</p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/wordpress-2-9-2-released-security-fix" rel="bookmark" title="WordPress 2.9.2 Released &#8211; Security Fix">WordPress 2.9.2 Released &#8211; Security Fix</a></li>\n<li><a href="http://www.wptavern.com/wordpress-2-9-1-released" rel="bookmark" title="WordPress 2.9.1 Released">WordPress 2.9.1 Released</a></li>\n<li><a href="http://www.wptavern.com/ideas-to-improve-the-wordpress-release-strategy" rel="bookmark" title="Ideas To Improve The WordPress Release Strategy">Ideas To Improve The WordPress Release Strategy</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/I0AIguisHyg" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 13 Dec 2011 14:00:20 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:47:"Weblog Tools Collection: WordPress 3.3 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10817";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/OQNyepz_bgU/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1449:"<p><a href="http://wordpress.org/">WordPress</a> 3.3 <a href="http://wordpress.org/news/2011/12/sonny/">is finally here</a> and ready to be <a href="http://wordpress.org/download/">downloaded</a> or upgraded to from the Updates section of your blog&#8217;s Dashboard.</p>\n<p>Of <a href="http://codex.wordpress.org/Version_3.3">all the changes</a>, the most noticeable are the simplified toolbar (formerly known as the admin bar), the new drag and drop media uploader with support for multiple files, hover-powered Dashboard menus (no more wasted clicks), better help menus, a new <a href="http://www.tumblr.com/">Tumblr</a> importer, and a complete introductory welcome page for new users.</p>\n<p>For developers, there&#8217;s a new version of jQuery, better help screen hooks, and <a href="http://codex.wordpress.org/Function_Reference/wp_editor">a new editor API</a>.</p>\n<p>If you&#8217;re running into trouble after upgrading to WordPress 3.3, there is <a href="http://wordpress.org/support/topic/troubleshooting-wordpress-33-master-list">a master list of known issues and FAQs</a> on the forums whichÂ will be updated regularly, and the kind volunteers in <a href="http://wordpress.org/support/">the support forums</a> will be more than happy to help you with any of your troubles.</p>\n<div id="v-I7NAw9Zk-1" class="video-player"></div>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/OQNyepz_bgU" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 13 Dec 2011 02:15:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:35:"Dev Blog: WordPress 3.3 âSonnyâ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2135";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:40:"http://wordpress.org/news/2011/12/sonny/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:16680:"<p>The latest and greatest version of the WordPress software &#8212; 3.3, named &#8220;Sonny&#8221; in honor of the great jazz saxophonist Sonny Stitt &#8212; is <a href="http://wordpress.org/download/">immediately available for download</a> or update inside your WordPress dashboard.</p>\n<p>WordPress has had over 65 million downloads since version 3.0 was released, and in this third major iteration we&#8217;ve added significant polish around the new user experience, navigation, uploading, and imports. Check out this short video that summarizes the things we think you&#8217;ll find are the cat&#8217;s pajamas:</p>\n<div id="v-I7NAw9Zk" class="video-player"></div>\n<h3>For Users</h3>\n<p>Experienced users will appreciate the new <strong>drag-and-drop uploader</strong>, hover menus for the navigation, the new toolbar, improved co-editing support, and the new Tumblr importer. We&#8217;ve also been thinking a ton about what the WordPress experience is like for people completely new to the software. Version 3.3 has significant improvements there with<strong>Â pointer tips</strong> for new features included in each update, a friendly welcome message for first-time users, and revamped help tabs throughout the interface. Finally we&#8217;ve improved the dashboard experience on the iPad and other tablets with better touch support.</p>\n<h3>For Developers</h3>\n<p>There is a ton of candy for developers as well. I&#8217;d recommend starting your exploration with the <a href="http://codex.wordpress.org/Function_Reference/wp_editor">new editor API</a>, new jQuery version, better ways to hook into the help screens, more performant post-slug-only permalinks, and of course the entire list of improvements <a href="http://codex.wordpress.org/Version_3.3">on the Codex</a> and <a href="http://core.trac.wordpress.org/milestone/3.3">in Trac</a>.</p>\n<h3>Roll the Credits</h3>\n<p>The Credits tab on the new About WordPress screen in the WordPress dashboard provides recognition for contributors to each release, but we like to thank them here as well.</p>\n<p><a href="http://profiles.wordpress.org/users/aaroncampbell">Aaron D. Campbell</a>, <a href="http://profiles.wordpress.org/users/jorbin">Aaron Jorbin</a>, <a href="http://profiles.wordpress.org/users/adambackstrom">Adam Backstrom</a>, <a href="http://profiles.wordpress.org/users/kawauso">Adam Harley</a>, <a href="http://profiles.wordpress.org/users/xknown">Alex Concha</a>, <a href="http://profiles.wordpress.org/users/alexkingorg">Alex King</a>, <a href="http://profiles.wordpress.org/users/viper007bond">Alex Mills (Viper007Bond)</a>, <a href="http://profiles.wordpress.org/users/amereservant">amereservant</a>, <a href="http://profiles.wordpress.org/users/ampt">ampt</a>, <a href="http://profiles.wordpress.org/users/lordandrei">Andrei Freeman</a>, <a href="http://profiles.wordpress.org/users/arena">Andre Renaut</a>, <a href="http://profiles.wordpress.org/users/andrewfrazier">andrewfrazier</a>, <a href="http://profiles.wordpress.org/users/nacin">Andrew Nacin</a>, <a href="http://profiles.wordpress.org/users/azaozz">Andrew Ozz</a>, <a href="http://profiles.wordpress.org/users/andrewryno">Andrew Ryno</a>, <a href="http://profiles.wordpress.org/users/andy">Andy Skelton</a>, <a href="http://profiles.wordpress.org/users/lumination">Anthony Atkinson</a>, <a href="http://profiles.wordpress.org/users/filosofo">Austin Matzko</a>, <a href="http://profiles.wordpress.org/users/simek">Bartosz Kaszubowski</a>, <a href="http://profiles.wordpress.org/users/benbalter">Benjamin J. Balter</a>, <a href="http://profiles.wordpress.org/users/brandondove">Brandon Dove</a>, <a href="http://profiles.wordpress.org/users/carlospaulino">carlospaulino</a>, <a href="http://profiles.wordpress.org/users/caspie">Caspie</a>, <a href="http://profiles.wordpress.org/users/cebradesign">cebradesign</a>, <a href="http://profiles.wordpress.org/users/chexee">Chelsea Otakan</a>, <a href="http://profiles.wordpress.org/users/chipbennett">Chip Bennett</a>, <a href="http://profiles.wordpress.org/users/chrisbliss18">Chris Jean</a>, <a href="http://profiles.wordpress.org/users/coenjacobs">Coen Jacobs</a>, <a href="http://profiles.wordpress.org/users/cgrymala">Curtiss Grymala</a>, <a href="http://profiles.wordpress.org/users/danielbachhuber">Daniel Bachhuber</a>, <a href="http://profiles.wordpress.org/users/koopersmith">Daryl Koopersmith</a>, <a href="http://profiles.wordpress.org/users/dllh">Daryl L. L. Houston</a>, <a href="http://profiles.wordpress.org/users/davecpage">David</a>, <a href="http://profiles.wordpress.org/users/dcowgill">David Cowgill</a>, <a href="http://profiles.wordpress.org/users/dgwyer">David Gwyer</a>, <a href="http://profiles.wordpress.org/users/damst">Da^MsT</a>, <a href="http://profiles.wordpress.org/users/deltafactory">deltafactory</a>, <a href="http://profiles.wordpress.org/users/demetris">demetris</a>, <a href="http://profiles.wordpress.org/users/valendesigns">Derek Herman</a>, <a href="http://profiles.wordpress.org/users/devinreams">Devin Reams</a>, <a href="http://profiles.wordpress.org/users/adeptris">Digital Raindrops</a>, <a href="http://profiles.wordpress.org/users/dd32">Dion Hulse (@dd32)</a>, <a href="http://profiles.wordpress.org/users/ocean90">Dominik Schilling (ocean90)</a>, <a href="http://profiles.wordpress.org/users/dougwrites">Doug Provencio</a>, <a href="http://profiles.wordpress.org/users/dragoonis">dragoonis</a>, <a href="http://profiles.wordpress.org/users/drewapicture">DrewAPicture</a>, <a href="http://profiles.wordpress.org/users/cyberhobo">Dylan Kuhn</a>, <a href="http://profiles.wordpress.org/users/eduplessis">eduplessis