"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:104:"http://feedproxy.google.com/~r/WordpressTavern/~3/NqrCavQxFmc/is-your-wordpress-install-selling-handbags";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1197:"<p>If you administer a WordPress powered website, you might want to check the directory structure, especially the WP-Content/Upgrade and WP-Content/Uploads to see if you notice a folder called Tall. <a href="http://wpmu.org/hacked-is-your-wordpress-site-being-turned-into-a-cheap-luxury-store/">According to the folks at WPMU.org</a>, one of their co-workers websites became a victim to an attack that involved an entirely new WordPress installation being installed along with an e-commerce system. While Google is reporting a ton of results, most of them appear to be sub-pages within the hacked domains and not individual sites. I&#8217;ve checked my own installs and everything seems to be fine. It needs to be stated that this is not known to be an exploit specifically with the WordPress software although the project team is aware of the findings by WPMU. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/vaultpress-now-supports-wordpress-multisite" rel="bookmark" title="VaultPress Now Supports WordPress Multisite">VaultPress Now Supports WordPress Multisite</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/NqrCavQxFmc" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 12 Dec 2011 18:00:03 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"WPTavern: Seven Things Not To Do When Localizing Themes And Plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5971";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:119:"http://feedproxy.google.com/~r/WordpressTavern/~3/hJQ4W0QJ1E0/seven-things-not-to-do-when-localizing-themes-and-plugins";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1495:"<p>David Decker <a href="http://genesisthemes.de/en/2011-12/seven-cardinal-sins-localizing-wordpress-plugins-themes/">has published his list</a> of seven cardinal sins that he&#8217;s run into when diving into the localization/internationalization of plugins and themes. For beginners who want to start making it easy for others to localize their code, you should read this article on the Codex entitled, <a href="http://codex.wordpress.org/Translating_WordPress">Translating WordPress</a>. While David didn&#8217;t chastise developers for their code, <a href="http://genesisthemes.de/en/2011-12/seven-cardinal-sins-localizing-wordpress-plugins-themes/#comment-15">Eric Mann weighed in</a> from a plugin authors point of view that I think many other developers can relate to. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/plugins-and-commericial-wordpress-sites" rel="bookmark" title="Plugins And Commercial WordPress Sites">Plugins And Commercial WordPress Sites</a></li>\n<li><a href="http://www.wptavern.com/upgrading-and-backwards-compatibility-for-plugins" rel="bookmark" title="Upgrading And Backwards Compatibility For Plugins">Upgrading And Backwards Compatibility For Plugins</a></li>\n<li><a href="http://www.wptavern.com/plugins-and-the-lack-of-change-logs" rel="bookmark" title="Plugins And The Lack Of Change Logs">Plugins And The Lack Of Change Logs</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/hJQ4W0QJ1E0" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 12 Dec 2011 14:00:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:52:"Weblog Tools Collection: WordPress 3.3 RC 3 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10815";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/dIrh8OrTzqo/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1228:"<p><a href="http://wordpress.org/">WordPress</a> 3.3 RC 3 <a href="http://wordpress.org/news/2011/12/wordpress-3-3-rc3/">has been released</a>. There were <a href="http://core.trac.wordpress.org/log/trunk/?action=stop_on_copy&mode=stop_on_copy&rev=19587&stop_rev=19568&limit=100">just a few things to fix</a>, so the final 3.3 release should be right around the corner.</p>\n<p>If you&#8217;re a plugin or theme developer, and you haven&#8217;t tested your products against WordPress 3.3 yet, you my have just a few days (if not hours) left before the final release is public.</p>\n<p>Andrew Nacin has provided an outstanding <a href="http://nacin.com/2011/12/07/wordpress-3-3-field-guide-for-developers/">WordPress 3.3 field guide for developers</a> and Mika Epstein has provided an awesome <a href="http://tech.ipstenu.org/master-list/">WordPress 3.3 known issue and FAQ master list</a>.</p>\n<p>As always, feel free to <a href="http://codex.wordpress.org/Reporting_Bugs">report any bugs</a> that you find and contact <a href="http://wordpress.org/support/forum/alphabeta">the support forums</a> if you need any help.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/dIrh8OrTzqo" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 12 Dec 2011 07:28:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Theme Releases for 12/11";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10810";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/vIgSabXvQio/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1191:"<p><img class="alignnone size-full wp-image-10811" title="bluewithgrey" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/bluewithgrey.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/blue-with-grey"><strong>Blue with Grey</strong></a> is a details-oriented theme with modern and decent design.</p>\n<p><img class="alignnone size-full wp-image-10812" title="simplygraphic" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/simplygraphic.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://emptynestthemes.com/2011/12/08/simply-graphic/"><strong>Simply Graphic</strong></a> is a clean, crisp theme using graphic elements and sharp lines.</p>\n<p><img class="alignnone size-full wp-image-10813" title="terminally" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/terminally.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://wordpress.org/extend/themes/terminally"><strong>Terminally</strong></a> is a HTML5 and CSS3 theme inspired by the popular Mac SSH client, Terminal.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/vIgSabXvQio" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 11 Dec 2011 14:00:58 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:43:"Dev Blog: WordPress 3.3 Release Candidate 3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2130";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:52:"http://wordpress.org/news/2011/12/wordpress-3-3-rc3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1709:"<p>The third (and hopefully final!) release candidate for WordPress 3.3 is now available. Since RC2, we&#8217;ve doneÂ <a href="http://core.trac.wordpress.org/log/trunk/?action=stop_on_copy&mode=stop_on_copy&rev=19587&stop_rev=19568&limit=100">a handful of last-minute tweaks and bugfixes</a>Â that we felt were necessary.</p>\n<p>Our goal is to release version 3.3 early next week, soÂ <strong>plugin and theme authors, this is your last pre-release chance to Â test your plugins and themesÂ </strong>Â to find any compatibility issues before the final release. We&#8217;ve publishedÂ <a href="http://wpdevel.wordpress.com/tag/3-3-dev-notes/">a number of posts</a>Â on the development blog that explain important things you need to know as you prepare for WordPress 3.3. Please review this information immediately if you have not done so already.</p>\n<p>If you think you&#8217;ve found a bug, you can post to theÂ <a href="http://wordpress.org/support/forum/alphabeta">Alpha/Beta area</a>Â in the support forums. Or, if you&#8217;re comfortable writing a reproducible bug report, file one onÂ <a href="http://core.trac.wordpress.org/">WordPress Trac</a>. Known issues that crop up will be listedÂ <a href="http://core.trac.wordpress.org/report/6">here</a>, but let&#8217;s all keep our fingers crossed for a quiet Sunday so we can get these new features into your hands early next week!</p>\n<p><em>To test WordPress 3.3, try theÂ <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a>Â (youâll want &#8220;bleeding edge nightlies&#8221;). Or you canÂ <a href="http://wordpress.org/wordpress-3.3-RC3.zip">download the release candidate here</a>Â (zip).</em></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 11 Dec 2011 00:27:32 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"Dev Blog: Core Team Meetup Time";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2127";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:56:"http://wordpress.org/news/2011/12/core-team-meetup-time/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2151:"<p>It&#8217;s almost that time again, when the WordPress core development team gets together in person to review the year&#8217;s progress and talk about priorities for the coming year. Next week <a href="http://profiles.wordpress.org/users/matt">Matt Mullenweg</a>, <a href="http://profiles.wordpress.org/users/markjaquith">Mark Jaquith</a>, <a href="http://profiles.wordpress.org/users/westi">Peter Westwood</a>, <a href="http://profiles.wordpress.org/users/azaozz">Andrew Ozz</a>, <a href="http://profiles.wordpress.org/users/nacin">Andrew Nacin</a>, <a href="http://profiles.wordpress.org/users/dd32">Dion Hulse</a>, <a href="http://profiles.wordpress.org/users/koopersmith">Daryl Koopersmith</a>, <a href="http://profiles.wordpress.org/users/duck_">Jon Cave</a>, and <a href="http://profiles.wordpress.org/users/jane">I</a> will meet at Tybee Island, GA, the same location as the last meetup.</p>\n<p>Last year we wanted to do a video town hall, but ran into technical and scheduling difficulties. This year we&#8217;re planning ahead, and will definitely make it happen. <a title="Questions thread" href="http://wordpress.org/support/topic/core-dev-team-meetup-qa">We&#8217;re currently taking questions</a>, and will record a series of town hall-style videos where we answer your questions. Ask about the roadmap, code, community, contributing, WordCamps, meetups, themes, plugins, features, you name it. No topic (as long as it is about WordPress) is off limits, and we&#8217;ll do our best to answer as many questions as we can while we are together. The videos will be posted to this blog and archived at <a href="http://wordpress.tv">WordPress.tv</a>.</p>\n<p>Last year the people who were in attendance also posted pictures and updates to Twitter using the <a title="#wptybee on Twitter" href="https://twitter.com/#!/search?q=%23wptybee">#wptybee</a> tag. We&#8217;ll use the same tag this year, so if you&#8217;re interested in following along, add it to your Twitter client as a search.</p>\n<p>What do you want to know from us? <a title="Questions thread" href="http://wordpress.org/support/topic/core-dev-team-meetup-qa">Ask away</a>!</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 11 Dec 2011 00:06:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"Jane Wells";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"Andrew Nacin: Credits page for WordPressÂ 3.3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:24:"http://nacin.com/?p=3776";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:59:"http://nacin.com/2011/12/09/credits-page-for-wordpress-3-3/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2372:"<p><a href="http://nacin.com/wp-content/uploads/2011/12/Screen-Shot-2011-12-09-at-6.27.46-PM.png"><img class="alignright size-full wp-image-3778" title="Screen Shot 2011-12-09 at 6.27.46 PM" src="http://nacin.com/wp-content/uploads/2011/12/Screen-Shot-2011-12-09-at-6.27.46-PM.png" alt="" width="650" height="272" /></a></p>\n<p>The WordPress 3.3 credits page was updated today, for likely the final time. In five months, there were nearly 1,200 individual changes to WordPress (and counting).</p>\n<p>The credits page lists every individual who contributed to the latest release. A few stood out for their contributions, not just of high quantity, but of tremendous quality: <strong>Dominik Schilling</strong> (ocean90), <strong>Cristi BurcÄ</strong> (scribu), and <strong>Sergey Biryukov</strong>.Â The three are listed as contributing developers to 3.3. The core team â including guest committers Jon Cave (duck_) and Daryl Koopersmith â worked with these three daily, and they had a collective hand in nearly every major task this release.*</p>\n<p>There were also three individuals added to the &#8216;Recent Rockstars&#8217; group for their recent contributions to core development. This release we chose <strong>Chelsea Otakan</strong> (chexee), <strong>Helen Hou-Sandi</strong>, and <strong>John Blackbourn</strong> (johnbillion). All together, the six contributing Â developers and rockstars we&#8217;ve recognized contributed more than a fourth of all Trac comments and two-fifths of all props.</p>\n<p>If you want to see the full list, click the WordPress icon in the 3.3 toolbar and head on over to the credits page, or wait for the release post (coming soon!).Â Maybe I&#8217;ll also experiment with a word cloud again as <a href="http://nacin.com/2010/04/30/visualizing-the-wordpress-3-0-contributors/">I&#8217;ve done in the past</a>.</p>\n<p>In WordPress 3.4, we plan to recognize first-time contributors on the page, so if want to see your name in lights on the credits page,Â <a href="http://codex.wordpress.org/Contributing_to_WordPress">contribute to WordPress</a>.</p>\n<p>* Fun fact: Average age of the five mentioned in this paragraph: 23.</p>\n<p class="share-sfc-stc"><a href="http://twitter.com/share?url=http%3A%2F%2Fwp.me%2FpQEdq-YU&count=horizontal&related=nacin&text=Credits%20page%20for%20WordPress%203.3" class="twitter-share-button"></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 10 Dec 2011 00:00:24 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"WPTavern: Limiting The Amount Of Text In Comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5968";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:101:"http://feedproxy.google.com/~r/WordpressTavern/~3/RqmQW4klzxw/limiting-the-amount-of-text-in-comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1150:"<p>Eric Teubert over at WPEngineer has <a href="http://wpengineer.com/2321/comment-length-limiter/">shared some Javascipt code</a> that can be used to limit the amount of text that users can place within the comments field or any text field for that matter. Could be used to combat those comment spammers that like to post a bazillion words but the negative side is that lengthy, legitimate commentators will need to be cut short. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/approve-delete-spam-how-do-you-treat-specific-comments" rel="bookmark" title="Approve, Delete, Spam &#8211; How Do You Treat Specific Comments?">Approve, Delete, Spam &#8211; How Do You Treat Specific Comments?</a></li>\n<li><a href="http://www.wptavern.com/easy-editable-text-regions" rel="bookmark" title="Easy Editable Text Regions">Easy Editable Text Regions</a></li>\n<li><a href="http://www.wptavern.com/wp-ajax-edit-comments-needs-new-dev" rel="bookmark" title="WP AJax Edit Comments Needs New Dev">WP AJax Edit Comments Needs New Dev</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/RqmQW4klzxw" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 09 Dec 2011 18:00:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:61:"WPTavern: WPShout Releases Results Of Their Webhosting Survey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5961";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:113:"http://feedproxy.google.com/~r/WordpressTavern/~3/xr-_CdP3aaI/wpshout-releases-results-of-their-webhosting-survey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3259:"<p><a href="http://www.wptavern.com/wp-content/uploads/2011/12/wpshoutlogo.png" rel="thumbnail"><img src="http://www.wptavern.com/wp-content/uploads/2011/12/wpshoutlogo.png" alt="WPshout Logo" title="wpshoutlogo" width="346" height="70" class="alignright size-full wp-image-5962" /></a>WPshout which is one of many sites devoted to WordPress has <a href="http://wpshout.com/wordpress-hosting-review/">published the results</a> of their early 2011 survey that asked readers to review their webhosting company. The results are from 252 independent reviews. In the grand scheme of things, this is a miniscule number but it&#8217;s cool to see so many independent reviews from WordPress centric customers in one place. WPTavern is running on HostGator and so far, I don&#8217;t have anything to complain about. When I&#8217;ve needed it, support has been great. The live chat actually works and for the most part, gets my issue settles without it being escalated. Unfortunately, it looks like many people who reviewed HostGator didn&#8217;t like the performance of their site. I&#8217;m on the opposite side of the spectrum where HostGator performs very well for me out of all the previous hosting providers I&#8217;ve used. </p>\n<blockquote><p>Hostgator had 23 reviews and, impressively for such a large number, everyone rated their experience and support as âgoodâ. A couple of people had had âsomeâ problem with downtime, but comments gave the impression support was quick and friendly. However, a number of people had moved away from Hostgator to another host and commented that their new hosting was much faster, suggesting Hostgatorâs a bit slow, just you donât really notice when youâre hosting with them. For this reason, Iâd consider the other hosts with more solid performance across the board.</p></blockquote>\n<p>It&#8217;s no surprise to me that GoDaddy ends up in last place with most of the reviewers mentioning that they switched hosts. Just as everyone has an opinion, they also have their choice of which webhosting provider to go with. Ask 100 people in a room which place should host your website and 75% of the answers will be different. With that said, you can add these independent reviews from WPShout to your list of legitimate researching material when it comes time to decide on a webhosting provider. </p>\n<p>By the way, for those that have an opinion on which host to go with, <a href="http://wpshout.com/hosting-survey/">WPShout is still conducting the survey</a> and has plans at some point to release more detailed information regarding the reviews. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/wptavern-is-back-i-think" rel="bookmark" title="WPTavern Is Back &#8211; I Think">WPTavern Is Back &#8211; I Think</a></li>\n<li><a href="http://www.wptavern.com/hostgator-now-has-quickinstall" rel="bookmark" title="HostGator Now Has QuickInstall">HostGator Now Has QuickInstall</a></li>\n<li><a href="http://www.wptavern.com/polldaddy-makes-digging-into-poll-data-easier" rel="bookmark" title="PollDaddy Makes Digging Into Poll Data Easier">PollDaddy Makes Digging Into Poll Data Easier</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/xr-_CdP3aaI" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 09 Dec 2011 14:00:53 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:13;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 12/9";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10807";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/kpVR03B_vas/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1619:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/benchmark-email-lite/"><strong>Benchmark Email Lite</strong></a> creates a newsletter signup form widget.</p>\n<p><a href="http://wordpress.org/extend/plugins/custom-category-templates/"><strong>Custom Category Templates</strong></a> allows you to define custom templates for category views.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://www.foxy-press.com/"><strong>FoxyPress</strong></a> is a custom plugin made to integrate FoxyCart e-commerce functionality into your WordPress website.</p>\n<p><a href="http://intensedebate.com/"><strong>IntenseDebate</strong></a> is a feature-rich comment system for WordPress, Blogger, Tumblr and many other blogging/CMS platforms.</p>\n<p><a href="http://jetpack.me/"><strong>Jetpack</strong></a> supercharges your self-hosted WordPress site with the awesome cloud power of WordPress.com.</p>\n<p><a href="http://wordpress.org/extend/plugins/joemobi/"><strong>Joemobi</strong></a> allows you to create native Android and BlackBerry applications from your WordPress site.</p>\n<p><a href="http://wordpress.org/extend/plugins/social/"><strong>Social</strong></a> allows you to broadcast posts to Twitter and/or Facebook, pull in items from each as comments, and allow commenters to use their Twitter/Facebook identities.</p>\n<p><a href="http://wordpress.org/extend/plugins/wp-super-cache/"><strong>WP Super Cache</strong></a> is a very fast caching engine for WordPress that produces static html files.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/kpVR03B_vas" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 09 Dec 2011 14:00:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:14;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"WPTavern: WordPress Optimization Guide By Dreamhost";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5958";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:103:"http://feedproxy.google.com/~r/WordpressTavern/~3/J6IkXUGU69Y/wordpress-optimization-guide-by-dreamhost";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:862:"<p>Dreamhost has a section on their Wiki <a href="http://wiki.dreamhost.com/WordPress_Optimization">explaining detailed ways</a> on how to optimize WordPress using such tools as WP Super Cache, Nocache, Fcgi, and various combinations of the latter. I don&#8217;t understand the gobbily gook presented within the document but if you&#8217;re using your own dedicated server or VPS, these tips might be of interest to you. An aside but <a href="http://digwp.com/2009/06/wordpress-configuration-tricks/">also interesting article</a> regarding WordPress configuration tricks was published by Jeff Star on the Digging Into WordPress site back in 2009. Lesson learned is that the WPConfig file that is apart of WordPress is pretty powerful. </p>\n\n\n<p>No related posts.</p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/J6IkXUGU69Y" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 Dec 2011 18:00:50 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:15;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:80:"WPTavern: Extensive Checklist For WordPress 3.3 That All Developers Should Check";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5955";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:132:"http://feedproxy.google.com/~r/WordpressTavern/~3/sHixOaIMhXA/extensive-checklist-for-wordpress-3-3-that-all-developers-should-check";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1311:"<p>Andrew Nacin who is one of the core developers of WordPress has published an <a href="http://nacin.com/2011/12/07/wordpress-3-3-field-guide-for-developers/">extensive field guide for developers</a> regarding WordPress 3.3. The guide contains links to relevant articles and discussions on the WordPress developers blog such as admin bar API changes, Javascript and editor changes, Help screen along with API changes, etc. All developers should take note of the links published by Andrew so you&#8217;re well prepared for the release. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/checklist-of-things-to-do-before-switching-themes" rel="bookmark" title="Checklist Of Things To Do Before Switching Themes">Checklist Of Things To Do Before Switching Themes</a></li>\n<li><a href="http://www.wptavern.com/andrew-nacin-previews-wordpress-3-3-at-wordpressnyc-meetup" rel="bookmark" title="Andrew Nacin Previews WordPress 3.3 At WordPressNYC Meetup">Andrew Nacin Previews WordPress 3.3 At WordPressNYC Meetup</a></li>\n<li><a href="http://www.wptavern.com/validation-and-sanitization-primer" rel="bookmark" title="Validation And Sanitization Primer">Validation And Sanitization Primer</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/sHixOaIMhXA" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 Dec 2011 14:00:47 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:16;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:52:"Weblog Tools Collection: WordPress 3.3 RC 2 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10802";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/3EgeD6M0_0A/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1129:"<p><a href="http://wordpress.org/">WordPress</a> 3.3 RC 2 <a href="http://wordpress.org/news/2011/12/wordpress-3-3-release-candidate-2/">has been released</a>. The team feels that WordPress 3.3 is just about ready to be released, so this could very well be the last release candidate before 3.3 is officially released.</p>\n<p>If you&#8217;re a plugin or theme developer, it&#8217;s time to test your products against WordPress 3.3 before the rest of the world gets their hands on it. Andrew Nacin has provided an outstanding <a href="http://nacin.com/2011/12/07/wordpress-3-3-field-guide-for-developers/">WordPress 3.3 field guide for developers</a> and Mika Epstein has provided an awesome <a href="http://tech.ipstenu.org/master-list/">WordPress 3.3 known issue and FAQ master list</a>.</p>\n<p>As always, feel free to <a href="http://codex.wordpress.org/Reporting_Bugs">report any bugs</a> that you find and contact <a href="http://wordpress.org/support/forum/alphabeta">the support forums</a> if you need any help.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/3EgeD6M0_0A" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 08 Dec 2011 14:00:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:17;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:55:"Andrew Nacin: WordPress 3.3 Field Guide forÂ Developers";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:24:"http://nacin.com/?p=3762";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:69:"http://nacin.com/2011/12/07/wordpress-3-3-field-guide-for-developers/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3160:"<p>Last night, WordPress 3.3 Release Candidate 2 was released. As written in <a href="http://wordpress.org/news/2011/12/wordpress-3-3-release-candidate-2/">the release post</a>, I think we&#8217;re really close to a final release.</p>\n<p>In preparation for that, I went on a tear yesterday and contributed to six posts for developers on our main development blog. The posts were a mixture of tutorials and API documentation what&#8217;s new and what&#8217;s changed in 3.3:</p>\n<ul class="paragraphs">\n<li><a href="http://wpdevel.wordpress.com/2011/12/07/admin-bar-api-changes-in-3-3/"><strong>Admin Bar API changes in 3.3</strong></a>. An overview of what changes might break your plugin, how we&#8217;ve tweaked the terminology and APIs for 3.3, the new Groups concept, and how to move and modify menu items.</li>\n<li><a href="http://wpdevel.wordpress.com/2011/12/07/whats-new-javascript-in-3-3/"><strong>What to watch for: Javascript and Editor changes</strong></a>. There were quite a bit of changes here. jQuery was updated to 1.7.1, the current version. The full jQuery UI is now included, and was updated to 1.8.16, also the current version. And then there&#8217;s an example for <code>wp_editor()</code>. The QuickTags API (the HTML editor toolbar buttons) was rewritten, and we&#8217;ve improved both <code>wp_localize_script()</code> and <code>wp_enqueue_script()</code>.</li>\n<li><a href="http://wpdevel.wordpress.com/2011/12/07/new-api-in-3-3-is_main_query/"><strong>New API: is_main_query()</strong></a>. I introduced this function and <code>WP_Query</code> method during my &#8216;You Don&#8217;t Know Query&#8217; talk in WordCamp Portland in September.</li>\n<li><a href="http://wpdevel.wordpress.com/2011/12/07/do-not-include-wp-adminincludestemplate-php-to-get-add_meta_box/"><strong>Do not include wp-admin/includes/template.php to get add_meta_box()</strong></a>. I&#8217;m not even sure where to start with this one. When developing 3.3, we found that some plugins were doing something wrong when trying to call <code>add_meta_box()</code>. (Really, really wrong.) So consider this post a protip.</li>\n<li><a href="http://wpdevel.wordpress.com/2011/12/07/admin_user_info_links/"><strong>The admin_user_info_links filter is gone</strong></a>. This needed to happen since we combined the admin bar with the admin header. Not too many plugins were using it. This comes after we dropped favorite actions in 3.2 as the UI continues to be refined.</li>\n<li><a href="http://wpdevel.wordpress.com/2011/12/06/help-and-screen-api-changes-in-3-3/"><strong>Help and screen API changes</strong></a>. This post goes through the process of adding new help tabs, as well as how to use the screen object to determine the context of the current page. I spent a lot of time fleshing out WP_Screen in 3.3, so it was nice to see it all summed up in just a few hundred words.</li>\n</ul>\n<p>WordPress 3.3 â coming soon to a site near you.</p>\n<p class="share-sfc-stc"><a href="http://twitter.com/share?url=http%3A%2F%2Fwp.me%2FpQEdq-YG&count=horizontal&related=nacin&text=WordPress%203.3%20Field%20Guide%20for%20Developers" class="twitter-share-button"></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 18:40:18 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:18;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:34:"WPTavern: Using Sidebars As Menus?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5952";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:85:"http://feedproxy.google.com/~r/WordpressTavern/~3/JI5dQ7p--U8/using-sidebars-as-menus";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1317:"<p>It&#8217;s an idea <a href="http://tech.ipstenu.org/2011/wordpress-sidebars-as-menus-part-2/">proposed by Ipstenu</a> that might just work. The gist of her suggestion is to manage widgets similar to how we manage menus. Instead of all that fancy drag and drop stuff, we switch to a check box approach where users can check which widgets they want to have added to a particular sidebar. Judging by the comments left on that post, a number of people feel that her concept is a great idea and should be considered when the time to rework the widget management area arrives. Drag and drop was cool when it arrived but having 3-5 sidebars with 30 available widgets makes drag and drop not so cool anymore. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/first-look-at-new-widget-interface" rel="bookmark" title="First Look At New Widget Interface">First Look At New Widget Interface</a></li>\n<li><a href="http://www.wptavern.com/widget-context-updated" rel="bookmark" title="Widget Context Updated">Widget Context Updated</a></li>\n<li><a href="http://www.wptavern.com/widgetizing-that-theme-of-yours" rel="bookmark" title="Widgetizing That Theme Of Yours">Widgetizing That Theme Of Yours</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/JI5dQ7p--U8" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 18:00:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:19;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7: