ta";s:31:"Wed, 07 Dec 2011 14:00:48 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:20;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:39:"WPTavern: Michael Fields Media Wishlist";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5950";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:91:"http://feedproxy.google.com/~r/WordpressTavern/~3/QtuStrKNJLo/michael-fields-media-wishlist";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1220:"<p>Michael Fields, one of the many theme wranglers for Automattic has <a href="http://wordpress.mfields.org/2011/wordpress-wishlist-media/">published his wishlist</a> of items he&#8217;d like to see implemented into the WordPress media manager. Of the things he mentioned, <em>The ability for a theme to define multiple types of images like Logo, Custom Header, Body Background, Content Background, etc. We have two of these already, but IMHO it would be awesome if themes could define more than these two</em> sounds like a really cool idea. What&#8217;s on your wishlist? </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/media-management-in-wordpress-29" rel="bookmark" title="Media Management In WordPress 2.9">Media Management In WordPress 2.9</a></li>\n<li><a href="http://www.wptavern.com/use-the-media-library-or-hand-code" rel="bookmark" title="Use The Media Library Or Hand Code?">Use The Media Library Or Hand Code?</a></li>\n<li><a href="http://www.wptavern.com/whats-in-store-with-wp-3-0" rel="bookmark" title="What&#8217;s In Store With WP 3.0">What&#8217;s In Store With WP 3.0</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/QtuStrKNJLo" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 14:00:41 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:21;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:90:"WordPress.tv: Cotton Rohrscheib: Making WordPress Profitable for Agencies and Design Firms";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=6762";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:129:"http://wordpress.tv/2011/12/07/cotton-rohrscheib-making-wordpress-profitable-for-agencies-and-design-firms-wordcamp-fayetteville/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2560:"<p>WordCamp Fayetteville #wcfay 2011 Blogger Track video 07 -</p>\n<p>Cotton Rohrscheib, Making WordPress Profitable for Agencies and Design Firms &#8211; WordCamp Fayetteville 2011, July 30.</p>\n<p>This presentation discusses the various advantages of using WordPress from an agency, or design firm perspective. In this presentation we will do comparisons between WordPress and other Content Management Solutions as well as demonstrate several methods that can help you deliver a better product to your clients and maximize your profits w/ less time and effort.</p>\n<div id="v-kP6AbYKS-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6762/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6762/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6762/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6762&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/07/cotton-rohrscheib-making-wordpress-profitable-for-agencies-and-design-firms-wordcamp-fayetteville/"><img alt="Cotton Rohrscheib, Making WordPress Profitable for Agencies and Design Firms &#8211; WordCamp Fayetteville" src="http://videos.videopress.com/kP6AbYKS/wordcamp-wcfay-11-fayetteville-blog-t007-cottonrohrscheibwpprofitableforagencies-hd720p_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 13:02:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wcfayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:22;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:43:"Dev Blog: WordPress 3.3 Release Candidate 2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2119";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:68:"http://wordpress.org/news/2011/12/wordpress-3-3-release-candidate-2/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2102:"<p>The second release candidate for WordPress 3.3 is now available!</p>\n<p>As the first release candidate was well-received, we think we&#8217;re <em>really</em> close to a final release. Primarily, we&#8217;ve ensured that new toolbar (the admin bar in 3.2) has a consistent appearance across all browsers, and the API for developers is now final. You can check our bug tracker for the <a href="http://core.trac.wordpress.org/log/trunk?action=stop_on_copy&mode=stop_on_copy&rev=19567&stop_rev=19531&limit=100&verbose=on">complete list of changes</a>.</p>\n<p><strong>Plugin and theme authors, please test your plugins and themes now</strong>, so that if there is a compatibility issue, we can figure it out before the final release. On our development blog, we&#8217;ve published <a href="http://wpdevel.wordpress.com/tag/3-3-dev-notes/">a number of posts</a> that explain important things you need to know as you prepare for WordPress 3.3.</p>\n<p>If you havenât tested WordPress 3.3 yet, now is the time â please though, not on your live site unless youâre adventurous. Once you install RC2, you can visit About WordPress page (hover over the WordPress logo in the top left) to see an overview of what&#8217;s to come in WordPress 3.3 (and what to test, of course).</p>\n<p>If you think you&#8217;ve found a bug, you can post to the <a href="http://wordpress.org/support/forum/alphabeta">Alpha/Beta area</a> in the support forums. Or, if you&#8217;re comfortable writing a reproducible bug report, file one on <a href="http://core.trac.wordpress.org/">WordPress Trac</a>. Known issues that crop up will be listed <a href="http://core.trac.wordpress.org/report/6">here</a>.</p>\n<p>Enjoy!</p>\n<p><em>To test WordPress 3.3, try the <a href="http://wordpress.org/extend/plugins/wordpress-beta-tester/">WordPress Beta Tester plugin</a> (youâll want &#8220;bleeding edge nightlies&#8221;). Or you can <a href="http://wordpress.org/wordpress-3.3-RC2.zip">download the release candidate here</a> (zip).</em></p>\n<p>Sometimes time slows down<br />\nbetween releases &#8211; like now<br />\nThis is RC2</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 06:26:57 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:23;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:111:"WordPress.tv: Forum with Michael Tilley, Kevin Kinder, Shannon Magsam, Alexa McGriff: Finding Your Niche Online";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=6755";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:63:"http://wordpress.tv/2011/12/06/forum-finding-your-niche-online/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3793:"<p>WordCamp Fayetteville #wcfay 2011 Blogger Track video 05 -</p>\n<p>WordCamp Fayetteville Forum: Finding Your Niche Online, Moderator Jon Schleuss</p>\n<p><a href="http://www.thecitywire.com/">TheCityWire.comâs</a> Michael Tilley, <a href="http://www.nwatunedin.com/">NWATunedIn.comâs</a> Kevin Kinder, <a href="http://nwamotherlode.com/">NWAMotherlode.comâs</a> Shannon Magsam and <a href="http://www.ozarknaturalfoods.com/onfblog/">OzarkNaturalFoods.comâs</a> Alexa McGriff will discuss their relatively new online publications, the challenges they face and how they measure success in their rapidly competitive markets.</p>\n<p>Michael Tilley represents the the City Wire, an online publication focused on business, politics and culture in Northwest Arkansas. The site began in 2006 as a community forum and emerged in 2008 as a news site. Tilley says they donât compete with anyone, offering focused content driven to the business elite of the Fort Smith area.</p>\n<p>Kevin Kinder covers the music scene of Northwest Arkansas at TunedIn. The blog started in 2007 as a compliment to the newspaper publication Whatâs Up from Northwest Arkansas Newspapers. It has since evolved into a place with live music reviews, show times and general music news.</p>\n<p>Shannon Magsam is the co-creator of NWA Motherlode, a website with helpful information for Northwest Arkansas mothers. She says she and her co-creator Gwen Rockwood decided the area needed a website for moms. Magsam said their website gives transitioning moms an âinstant community.â</p>\n<p>Alexa McGriff is part of Ozark Natural foods, a Fayetteville food co-op. She says they started blogging last November to provide another avenue for the company to connect with their customers. McGriff says they use the blog to educate customers on different products, give recipes and news updates on the organic food industry.</p>\n<div id="v-5KfzlH5X-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6755/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6755/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6755/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6755&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/06/forum-finding-your-niche-online/"><img alt="WordCamp Fayetteville #wcfay Forum: Finding Your Niche Online, Moderator Jon Schleuss" src="http://videos.videopress.com/5KfzlH5X/wordcamp-wcfay-11-fayetteville-blog-t005-jonschleusspanelfindingniche-hd720p_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 07 Dec 2011 03:04:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wcfayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:24;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:62:"WordPress.tv: Jane Wells: WordCamp Fayetteville 2011 Town Hall";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=6751";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://wordpress.tv/2011/12/06/jane-wells-wordcamp-fayetteville-2011-town-hall/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2782:"<p>WordCamp Fayetteville 2001 WordPress Video 04 -</p>\n<p>WordPress Town Hall presented by Jane Wells.Â  She answers questions from the #wcfay audience.</p>\n<p>Jane Wells wrote: &#8220;I wear a lot of hats when it comes to WordPress: Iâm the user experience lead, I project manage the open source core development, I handle community initiatives under the aegis of the WordPress Foundation, and Iâm the team lead for Automatticâs âDot Orgâ team, which is a group of employees who work full-time on open source contributions. In the keynote session Iâll give you an idea of what weâre working on and whatâs coming up in the near future, but hope to spend most of the allotted time taking questions. What do you want to know about WordPress, tho community, contributing to WordPress, WordCamps, or anything else that falls in this general topic? Bring your questions!&#8221;</p>\n<div id="v-bSIjEL4Q-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6751/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6751/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6751/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6751&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/06/jane-wells-wordcamp-fayetteville-2011-town-hall/"><img alt="Jane Wells, WordPress Town Hall &#8211; WordCamp Fayetteville 2011" src="http://videos.videopress.com/bSIjEL4Q/wordcamp-wcfay-11-fayetteville-blog-t004-janewellsanswerquestions-hd720p_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 19:02:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wcfayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:25;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"WPTavern: Removing The Browser Nag Bar In WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5943";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:103:"http://feedproxy.google.com/~r/WordpressTavern/~3/q84w-kO0S6M/removing-the-browser-nag-bar-in-wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1836:"<p>Scott Reilley who also goes by <a href="http://profiles.wordpress.org/users/coffee2code/">Coffee2Code</a> is continuing his trend of releasing small but useful plugins for niche audiences. This time, he has released a plugin called <a href="http://wordpress.org/extend/plugins/no-browser-nag/">No Browser Nag</a> that removes the Outdated Browser nag found within newer versions of WordPress. </p>\n<p><a href="http://www.wptavern.com/wp-content/uploads/2011/12/WPbrowsernag.png" rel="thumbnail"><img src="http://www.wptavern.com/wp-content/uploads/2011/12/WPbrowsernag.png" alt="WordPress Browser Nag" title="WPbrowsernag" width="482" height="211" class="aligncenter size-full wp-image-5946" /></a></p>\n<p>While it&#8217;s a bit foolish to condone the use of outdated browsers, sometimes users don&#8217;t have a choice. At least with this plugin, that user group will be able to remove the constant nag and allow WordPress to get off their backs about a situation they may not be able to control. However, if possible, you should upgrade to the newest versions of your browser of choice as they often contain important security updates, performance improvements, etc. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/wp-super-cache-1-0-released" rel="bookmark" title="WP Super Cache 1.0 Released">WP Super Cache 1.0 Released</a></li>\n<li><a href="http://www.wptavern.com/share-your-wordpress-security-nightmare" rel="bookmark" title="Share Your WordPress Security Nightmare">Share Your WordPress Security Nightmare</a></li>\n<li><a href="http://www.wptavern.com/plugin-authors-and-the-activation-hook" rel="bookmark" title="Plugin Authors And The Activation Hook">Plugin Authors And The Activation Hook</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/q84w-kO0S6M" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 18:00:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:26;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:57:"Weblog Tools Collection: The Rise in WordPress Popularity";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10783";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/jKmbMvceZdk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2341:"<p>It&#8217;s no doubt that the popularity of <a href="http://wordpress.org/">WordPress</a> has soared as of late, even surpassing giants such as <a href="http://www.joomla.org/">Joomla</a> and <a href="http://drupal.org/">Drupal</a> in general usage. <a href="http://wp.smashingmagazine.com/2011/11/29/wordpress-cms-crown-drupal-joomla/">A recent article</a> from <a href="http://www.smashingmagazine.com/">Smashing Magazine</a> highlights some interesting points along WordPress&#8217;s climb to greatness, with some rather spot-on speculation for how WordPress has managed to surpass its assumed competition.</p>\n<p><a href="http://www.google.com/trends?q=WordPress%2C+Joomla%2C+Drupal"><img class="aligncenter size-full wp-image-10790" title="WordPress vs Joomla vs Drupal" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/wordpressvs2.jpg" alt="WordPress vs Joomla vs Drupal" width="400" height="198" /></a></p>\n<p>Of course, there&#8217;s the obvious factor of WordPress&#8217;s ease of use and development that have propelled it forward significantly, but its focus on blogging is what has really set it apart. WordPress has certainly grown into a rather capable CMS, but it&#8217;s a blogging platform first and foremost, and you&#8217;ll be hard-pressed to find a single feature in WordPress that can&#8217;t be used by a general blogger. When you focus on a specific direction, you can use all of your creative talent and energy to build a solid product that does exactly what it&#8217;s supposed to do, empower a blogger to do something great, like <a href="http://en.blog.wordpress.com/2011/12/05/biggest-news-2011/">cover some of the biggest news stories of 2011</a> with more details and more facts than most major news companies.</p>\n<p>Without a doubt, every platform has its purpose and there are certainly folks out there who will find one platform to be of more use to them than the other (as the founders of Drupal and WordPress <a href="http://weblogtoolscollection.com/archives/2011/10/17/wordpress-vs-drupal-on-stage/">have already discussed</a>), but it&#8217;s WordPress&#8217;s focus on blogging and slow growth into the CMS-sphere that is really propelling it as the platform of choice.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/jKmbMvceZdk" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 14:00:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:27;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:37:"WPTavern: WP Super Cache 1.0 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5940";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:89:"http://feedproxy.google.com/~r/WordpressTavern/~3/LSiD6EMVqdE/wp-super-cache-1-0-released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1402:"<p>Congrats to Donncha O Caoimh for <a href="http://ocaoimh.ie/2011/12/05/wp-super-cache-1-0/">releasing version 1.0</a> of his popular caching plugin, WP Super Cache. The release is an incremental improvement over previous versions but contains a number of bugfixes and new features such as a &#8220;<em>Delete Cache</em>&#8221; link within the admin bar. Back in 2009 when the plugin was first released, it was <strong>THE</strong> plugin that everyone suggested using if you wanted to increase performance on your site due to caching. Now a days, it seems as though W3 Total Cache has taken over that position. However, it&#8217;s nice to see Donncha still improving the plugin to provide users an alternate choice in caching solutions. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/gravityforms-1-5-released-tons-of-new-stuff" rel="bookmark" title="GravityForms 1.5 Released &#8211; Tons Of New Stuff">GravityForms 1.5 Released &#8211; Tons Of New Stuff</a></li>\n<li><a href="http://www.wptavern.com/gravityforms-1-1-released" rel="bookmark" title="GravityForms 1.1 Released">GravityForms 1.1 Released</a></li>\n<li><a href="http://www.wptavern.com/custom-meta-boxes-0-7-released" rel="bookmark" title="Custom Meta Boxes 0.7 Released">Custom Meta Boxes 0.7 Released</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/LSiD6EMVqdE" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 14:00:06 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:28;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:135:"WordPress.tv: Lela Davidson: Social Media Consistency â Skip the Overwhelm and Create a Schedule That Works â WordCamp Fayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=6769";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:144:"http://wordpress.tv/2011/12/06/lela-davidson-social-media-consistency-skip-the-overwhelm-and-create-a-schedule-that-works-wordcamp-fayetteville/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2822:"<p>WordCamp Fayetteville #wcfay 2011 Blogger Track video 06 -</p>\n<p>Lela Davidson, Social Media Consistency: Skip the Overwhelm and Create a Schedule That Works</p>\n<p>One of the keys to a successful social media campaign is consistency. However, like a lot of other business development actions, blogging and social network updates are often pushed to the bottom of the to-do list to make time for more urgent matters. Even worse, they are often avoided altogether out of fear they will become overwhelming. Social media is always on, but you donât have to be. In this session, attendees decide what social media can and cannot do for their particular business or project. They then go through a process of defining an objective for their blog or social media site and then craft an updating schedule that moves them toward achieving that goal.</p>\n<div id="v-AEPDXYVz-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6769/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6769/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6769/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6769&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/06/lela-davidson-social-media-consistency-skip-the-overwhelm-and-create-a-schedule-that-works-wordcamp-fayetteville/"><img alt="WordCamp Fayetteville Lela Davidson, Social Media Consistency" src="http://videos.videopress.com/AEPDXYVz/wordcamp-wcfay-11-fayetteville-blog-t006b-edited-leladavidsonsocialmedia-hd720p-smaller650mb_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 12:55:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wcfayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:29;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:54:"WordPress.tv: Keith Crawford: Getting Things Published";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=6807";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:71:"http://wordpress.tv/2011/12/05/keith-crawford-getting-things-published/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2398:"<p>WordCamp Fayetteville video 08 -</p>\n<p>Keith Crawford Geting Things Published presentation, excerpt of Evernote tips intro section.</p>\n<p>This presentation will discuss tips and tools for creating content in the midst of a hectic schedule. Expect practical and actionable advice to make capturing ideas and publishing more effective and efficient. Weâll cover specific WordPress tools and how to improve the process of blogging. This is a survival guide for blogging while busy.</p>\n<div id="v-qqKON31t-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/6807/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/6807/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/6807/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=6807&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/05/keith-crawford-getting-things-published/"><img alt="WordCamp Fayetteville Keith Crawford Geting Things Published Evernote tips" src="http://videos.videopress.com/qqKON31t/wordcamp-wcfay-11-fayetteville-blog-t008-keithcrawfordgettingthingspublishedevernote-hd720p_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 06 Dec 2011 03:07:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wcfayetteville";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:30;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:27:"Donncha: WP Super Cache 1.0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:29:"http://ocaoimh.ie/?p=89496606";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:48:"http://ocaoimh.ie/2011/12/05/wp-super-cache-1-0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3494:"<p><a href="http://wordpress.org/extend/plugins/wp-super-cache/">WP Super Cache</a> is a fast page caching plugin for WordPress that can significantly speed up websites.</p>\n<p>The first release of this plugin was in September 2009 so this has been a bit too long in the making. Back then the main caching plugin was WP Cache, which this plugin is based on, but now there are quite a few including W3 Total Cache, Hypercache, Quick Cache and <a href="http://wordpress.org/extend/plugins/search.php?q=caching">many more</a>.</p>\n<p>Version 1.0 is an incremental upgrade from the previous release but it has a number of bugfixes and new features:</p>\n<ol>\n<li> The all new <a href="http://ocaoimh.ie/2011/11/29/wp-super-cache-scheduler-and-admin-bar-link/">scheduler and admin bar link</a> should please many people, especially those who want to clear the cache on their site at particular times. The &#8220;Delete Cache&#8221; admin bar link is something people have been asking about for as long as WordPress has had that bar!</li>\n<li> You can preload <a href="http://ocaoimh.ie/2011/10/19/preload-categories-and-custom-post-content/">categories and taxonomies</a> although this hasn&#8217;t really been tested as well as I&#8217;d like. It works for me but YMMV.</li>\n<li> There&#8217;s <a href="http://ocaoimh.ie/2011/07/11/get-a-sneak-preview-of-wp-super-cache-before-1-0/">better support for mobile and https users</a> now. Mobile support should scale a lot more than previously.</li>\n<li> The cache tester is fixed now and the plugin traps as many errors as possible. It&#8217;ll also spit out some helpful text if there is a problem. 99% of the time it&#8217;s because the server can&#8217;t request a page from itself.</li>\n<li> At the risk of annoying users who comment on your site you can make them appear to be anonymous users which will drastically help your server if they like commenting a lot. Unfortunately it stops the comment form populating with their details so it might be worth using an external comment system like Intense Debate or Disqus!</li>\n<li> The Advanced Settings page now lists a &#8220;do not cache page&#8221; secret key. Use this key to view any page of your site uncached.</li>\n<li> The cache file listing and delete links should work again now.</li>\n<li> And many many more bug fixes.</li>\n</ol>\n<p>Once you upgrade go visit the settings page and check out what&#8217;s new there. The upgrade worked fine for me, but there&#8217;s no harm looking. Pay close attention to the new garbage collector. The scheduler is rather powerful and flexible so it&#8217;s worth setting up right.</p>\n<p>If you have any problems please leave a comment here or use <a href="http://wordpress.org/tags/wp-super-cache?forum_id=10">the support forum</a>.</p>\n <img src="http://ocaoimh.ie/wp-content/plugins/wordpress-feed-statistics/feed-statistics.php?view=1&post_id=89496606" width="1" height="1" />\n<p><strong>Related Posts</strong><ul><li> <a href="http://ocaoimh.ie/2008/10/24/wp-super-cache-084-the-garbage-collector/" rel="bookmark" title="Permanent Link: WP Super Cache 0.8.4, the garbage collector">WP Super Cache 0.8.4, the garbage collector</a></li><li> <a href="http://ocaoimh.ie/2009/01/09/wp-super-cache-087/" rel="bookmark" title="Permanent Link: WP Super Cache 0.8.7">WP Super Cache 0.8.7</a></li><li> <a href="http://ocaoimh.ie/2010/02/08/wp-super-cache-099/" rel="bookmark" title="Permanent Link: WP Super Cache 0.9.9">WP Super Cache 0.9.9</a></li></ul></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 05 Dec 2011 18:10:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:16:"Donncha O Caoimh";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:31;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:52:"Andrew Nacin: When Did You Last Blog? A FreshÂ Start";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:24:"http://nacin.com/?p=3691";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://nacin.com/2011/12/05/when-did-you-last-blog/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4292:"<p>You know it&#8217;s bad when the most influential people in your life have all ganged up on you.</p>\n<p>My best friend Ben Balter wrote a script called <a href="http://ben.balter.com/sandbox/when-did-nacin-last-blog/">When Did Nacin Last Blog</a> (don&#8217;t worry, <a href="https://github.com/benbalter/When-Did-Nacin-Last-Blog">it&#8217;s on Github</a>).</p>\n<p>My girlfriend planted the &#8220;When did you last blog?&#8221; question at WordCamp Richmond last month.</p>\n<p>My own father called me in October while I was in Seattle to quiz me on when my last blog post was (&#8220;April 16,&#8221; I knew off the top of my head), after which he pointed out I was also in Seattle then.</p>\n<p>My boss recently sent me aÂ friendly reminder letting me know it&#8217;s been 229 days since my last post. I wouldn&#8217;t be surprised if Matt used Ben&#8217;s tool.</p>\n<p>It&#8217;s not that I don&#8217;t post to blogs. In the last 233 days, I&#8217;ve posted 19 times to the <a href="http://wpdevel.wordpress.com/author/nacin/">WordPress development P2</a>, 16 times to <a href="http://wppolyglots.wordpress.com/author/nacin/">our translators blog</a>, and three times to the <a href="http://wordpress.org/news/author/nacin/">WordPress Blog</a>.</p>\n<p>And it&#8217;s not that I don&#8217;t write. I useÂ <a href="http://twitter.com/nacin">Twitter</a>Â as a microblogging tool to share links and ideas. And since April 16, I&#8217;ve posted more than 2,600 comments on the WordPress bug tracker, and opened 81 tickets. (Exactly one-third remain open.)</p>\n<p>I think the problem is two-fold. I don&#8217;t make time to blog, even though posting to a personal blog might as well be a job responsibility for me. I truly love blogging and web publishing, it&#8217;s just that after spending 60 hours a week on building, testing, and using web publishing software, I typically want to take a break.Â Second, I find other ways to publish most of the content I would publish, whether it&#8217;s on our bug tracker or on Twitter.</p>\n<p>I&#8217;d like to change both of those things. So I&#8217;ve done some things to prepare for a change in routine.</p>\n<p>I&#8217;ve switched to the Twenty Eleven theme using the one-column layout. I probably prefer Twenty Ten visually, but Twenty Eleven supports a number of post formats that I hope to leverage while microblogging. I have a feeling I&#8217;ll continue to tinker with this blog&#8217;s appearance â I&#8217;ve liked the designs and blogging styles of a <a title="Andrew Spittle" href="http://andrewspittle.net/">few</a> <a title="Alex Byers" href="http://byersalex.com/">good</a>Â <a title="Daniel Bachhuber" href="http://danielbachhuber.com/">friends</a>.</p>\n<p>Just a month ago, I finally acquired the nacin.com domain, which I&#8217;ve wanted for many years. Until this weekend, the site resided at andrewnacin.com, but given that nacinÂ is my identity both online and in real life (I&#8217;m called Nacin more than Andy or Andrew), it wasÂ symbolicallyÂ important to me. (Thanks Pete Mall for being my proxy for negotiations.)</p>\n<p>I have been keeping a list of potential essays to write, and started to draft a number of future posts. With the final release of WordPress 3.3 is just around the corner, there are a number of tutorials for cool new APIs I could probably cover. There&#8217;s a lot more I can write about â in the last nine months, I&#8217;ve worked on both coasts to get open source in newsrooms and government agencies. I&#8217;ve attended meetups in New York, Seattle, and of course D.C.Â I&#8217;ve evangelized WordPress at nine WordCamps, a PHP conference, and a BBQ festival.</p>\n<p>I&#8217;ll also be posting links, quotes, and ideas that would normally go straight to Twitter. Lots of WordPress, yes, but you&#8217;ll likely see an infusion of non-WordPress things I find interesting, particularly in the areas and intersections of technology, open source, journalism, and politics (based on some of my recent tweets). I last blogged 233 days ago. It&#8217;s time this has changed.</p>\n<p class="share-sfc-stc"><a href="http://twitter.com/share?url=http%3A%2F%2Fwp.me%2FpQEdq-Xx&count=horizontal&related=nacin&text=When%20Did%20You%20Last%20Blog%3F%20A%20Fresh%20Start" class="twitter-share-button"></a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 05 Dec 2011 15:39:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:32;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 12/5";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10780";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/GjtUBTdPqsY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1043:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/pricing-table/"><strong>Pricing Table</strong></a> comes with very flexible and dynamic options for creating a pricing table just in a few seconds.</p>\n<p><a href="http://wordpress.org/extend/plugins/quick-notice/"><strong>Quick Notice Bar</strong></a> will help the admin to publish highlighted notices on the site header.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/download-manager/"><strong>Download Manager</strong></a> will help you to manage, track and control file downloads from your site.</p>\n<p><a href="http://scribu.net/wordpress/posts-to-posts"><strong>Posts 2 Posts</strong></a> allows you to create many-to-many connections between posts of all kinds.</p>\n<p><a href="http://wordpress.org/extend/plugins/wpstorecart/"><strong>wpStoreCart</strong></a> is a free, open source, and full featured e-commerce platform.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/GjtUBTdPqsY" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 05 Dec 2011 15:15:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:33;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"WPTavern: Case Study On How WordPress Won The Crown";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5934";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:103:"http://feedproxy.google.com/~r/WordpressTavern/~3/FKS4lDTfXTg/case-study-on-how-wordpress-won-the-crown";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2085:"<p><a href="http://wp.smashingmagazine.com/2011/11/29/wordpress-cms-crown-drupal-joomla/">Interesting case study</a> using a number of cool data points that shows how WordPress has won the crown amongst Joomla and Drupal for being the most widely used CMS in the world. One things for sure, it certainly paid off for WordPress to be focused on making the democratization of content publishing as easy as possible first, then making WordPress incredibly extensible later. There is an entire laundry list of reasons of why WordPress is at the top of the mountain right now, the success of the platform can not be traced back to one thing. The comments in the article contain a couple of those reasons while the others are spread amongst the various comment and forum threads on the web. </p>\n<p>The past 7-8 years is very interesting to look back upon to figure out how WordPress ended up in it&#8217;s current spot of being the <del datetime="2011-12-06T18:38:55+00:00">best in breed within the content management space</del>. But, what I find even more interesting is if whether or not the things that made WordPress successful in the past will continue to stick around so that the platform is equally or more successful in the future. Focus, ease of use, extensibility, etc. Be right back, I&#8217;m going to go  ask my magic 8 ball. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/from-the-other-side-of-the-fence-how-wordpress-won" rel="bookmark" title="From The Other Side Of The Fence &#8211; How WordPress Won">From The Other Side Of The Fence &#8211; How WordPress Won</a></li>\n<li><a href="http://www.wptavern.com/joomla-against-drupal-against-wordpress" rel="bookmark" title="Joomla Against Drupal Against WordPress">Joomla Against Drupal Against WordPress</a></li>\n<li><a href="http://www.wptavern.com/the-header-wont-be-changing-in-28" rel="bookmark" title="The Header Won&#8217;t Be Changing In 2.8">The Header Won&#8217;t Be Changing In 2.8</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/FKS4lDTfXTg" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 05 Dec 2011 14:00:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:34;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 12/3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10775";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/pK4KLqOjEMw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:986:"<p><img class="alignnone size-full wp-image-10776" title="mixinstyles" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/mixinstyles.jpg" alt="" width="150" height="113" /></p>\n<p><a href="http://www.jasong-designs.com/2011/11/30/mixin-styles/"><strong>Mixin&#8217; Styles</strong></a> makes use of advanced CSS 3 features such as rounded corners, text shadow and font embedding, but renders just fine in browsers that do not support CSS 3. You can change several color schemes and backgrounds from the Styling theme options page.</p>\n<p><img class="alignnone size-full wp-image-10777" title="wpeden" src="http://weblogtoolscollection.com/wp-content/uploads/2011/12/wpeden.jpg" alt="" width="150" height="109" /></p>\n<p><a href="http://wpeden.com/product/wp-eden-wordpress-theme/"><strong>WP Eden</strong></a> is a fast-loading CSS-based theme with no images.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/pK4KLqOjEMw" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 03 Dec 2011 14:00:46 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:35;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:85:"WordPress.tv: Jonathan Wondrusch: Turning WordPress into a CMS with Custom Post Types";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=8645";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:102:"http://wordpress.tv/2011/12/03/jonathan-wondrusch-turning-wordpress-into-a-cms-with-custom-post-types/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1884:"<div id="v-o3nAtEL0-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/8645/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comm