ress Powered Site</a></li>\n<li><a href="http://www.wptavern.com/top-5-wordpress-security-tips-you-most-likely-dont-follow" rel="bookmark" title="Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow">Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow</a></li>\n<li><a href="http://www.wptavern.com/wpweekly-episode-72-end-user-responsibility-and-wordpress-security" rel="bookmark" title="WPWeekly Episode 72 &#8211; End User Responsibility And WordPress Security">WPWeekly Episode 72 &#8211; End User Responsibility And WordPress Security</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/pgRCaIBVm4A" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 02 Dec 2011 18:00:59 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:39;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:47:"WPTavern: Feature Filled Comment Administration";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5926";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:99:"http://feedproxy.google.com/~r/WordpressTavern/~3/dCNkTgb-TmQ/feature-filled-comment-administration";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2538:"<p>Comment administration within WordPress has come a long way. <a href="http://lorelle.wordpress.com/2011/11/28/18-things-you-can-do-on-the-wordpress-comments-panel/">As illustrated by Lorelle VanFossen</a>, the comment administration panel these days has 18 different features for comment management. While the current iteration of comment management features are great, there is one particular quick link that I hope gets added in a future version of WordPress. It&#8217;s called &#8216;<em>De-Link</em>&#8216; and it&#8217;s one of my favorite features of the <a href="http://wordpress.org/extend/plugins/wp-ajax-edit-comments/">WP Ajax Edit comments plugin</a>. </p>\n<div id="attachment_5927" class="wp-caption aligncenter"><a href="http://www.wptavern.com/wp-content/uploads/2011/12/delinkInAjaxEditComments.png" rel="thumbnail"><img src="http://www.wptavern.com/wp-content/uploads/2011/12/delinkInAjaxEditComments.png" alt="" title="delinkInAjaxEditComments" width="284" height="155" class="size-full wp-image-5927" /></a><p class="wp-caption-text">Delinking Feature Within WP Ajax Edit Comments</p></div>\n<p>I&#8217;ve noticed that a large amount of comments that I have deleted or trashed in the past can now be approved after I de-link them as the content is usually related to the post. It&#8217;s their way of trying to get a link on the site. I have my own rules for which sites are allowed to be linked to and which are not but if the comment is relevant to the post at hand but contains a bad link, I&#8217;ll simply de-link, then approve it. Sure, I could go into the Quick Edit mode within the comment management area and manually remove the links but the method of clicking once sure seems a lot easier to me then clicking the mouse button a few times. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/wp-ajax-edit-comments-needs-new-dev" rel="bookmark" title="WP AJax Edit Comments Needs New Dev">WP AJax Edit Comments Needs New Dev</a></li>\n<li><a href="http://www.wptavern.com/please-adopt-this-plugin-comment-quicktags-reloaded" rel="bookmark" title="Please Adopt This Plugin &#8211; Comment Quicktags Reloaded">Please Adopt This Plugin &#8211; Comment Quicktags Reloaded</a></li>\n<li><a href="http://www.wptavern.com/request-deletion-now-part-of-ajax-edit-comments" rel="bookmark" title="Request Deletion Now Part Of Ajax Edit Comments">Request Deletion Now Part Of Ajax Edit Comments</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/dCNkTgb-TmQ" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 02 Dec 2011 14:00:53 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:40;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:66:"WordPress.tv: Justin Sainton: Roll Your Own Groupon with WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.tv/?p=8649";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://wordpress.tv/2011/12/02/justin-sainton-roll-your-own-groupon-with-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1844:"<div id="v-K6g6NurK-1" class="video-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/8649/"><img alt="" border="0" src="http://feeds.wordpress.co