eo-player">\n</div>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godelicious/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/delicious/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gofacebook/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/facebook/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gotwitter/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/twitter/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gostumble/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/stumble/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/godigg/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/digg/wptv.wordpress.com/8532/" /></a> <a rel="nofollow" href="http://feeds.wordpress.com/1.0/goreddit/wptv.wordpress.com/8532/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/reddit/wptv.wordpress.com/8532/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=8532&subd=wptv&ref=&feed=1" width="1" height="1" /><div><a href="http://wordpress.tv/2011/12/01/ben-metcalfe-wordpress-optimization/"><img alt="WordPress Optimization" src="http://videos.videopress.com/XSnXh7Ny/wordpress-optimization2_std.original.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 02 Dec 2011 03:08:11 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"wordcampphilly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:43;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:23:"Lloyd: You Do Not Scale";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://foolswisdom.com/?p=3079";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:40:"http://foolswisdom.com/you-do-not-scale/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1718:"<blockquote cite="http://geemus.com/blog/2011/11/27/less-is-more/"><p>&#8220;Most developers are itching to be a part of their favorite projects. You do not scale, but by giving developers tools and getting out of their way, your project can. So please remember that when issues are reported on your open source project, you should not fix them. I hope this serves you well and would love to hear about your experiences and help any way I can.&#8221;<br />\n<cite>By <a href="http://geemus.com">Wesley Bear</a>y in &#8220;<a href="http://geemus.com/blog/2011/11/27/less-is-more/">Less is More</a> published Nov 27, 2011. Hat tip <a href="http://hyperboledesign.com/">Jake Dahn</a>.</cite></p></blockquote>\n<p>A leader will always lead by being prepared to do the work themselves, but I&#8217;m really feeling what <a href="https://twitter.com/geemus">@geemus</a> wrote.</p>\n<p>It is in the ethos of the WordPress community, and the company, my former employer, <a href="http://ma.tt/">Matt Mullenweg</a> formed to support it. Here is my favorite part of <a href="http://ma.tt/2011/09/automattic-creed/">the Automattic Creed</a>:</p>\n<blockquote><p>&#8220;I will never pass up an opportunity to help out a colleague, and Iâll remember the days before I knew everything.&#8221;</p></blockquote>\n<p>I&#8217;m excited by the help I&#8217;m receiving from my new colleagues at <a href="http://www.pistoncloud.com/">Piston Cloud</a> and the <a href="http://www.openstack.org/">OpenStack community</a>.</p>\n<p>Pistoneers are kindred spirits of Automatticians. Before joining the Piston Cloud team I noted automation being a regular theme on &#8220;<a href="http://www.pistoncloud.com/category/team/">Our Team</a>&#8220;.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 01 Dec 2011 19:57:31 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"Lloyd";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:44;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:53:"WPTavern: How Ryan Imel Created The WP Quarterly Page";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5923";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:105:"http://feedproxy.google.com/~r/WordpressTavern/~3/1yfcjdI87dw/how-ryan-imel-created-the-wp-quarterly-page";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1271:"<blockquote><p>One comment I have that applies to all of the e-commerce plugins I tried out is this: the initial setup process is quite overwhelming. During my toying process I set up the basic Quarterly sales items and process for each plugin on a testing location. Without exception, each plugin presented me with options I never ended up needing, or didnât even care about. I realize that WPCandyâs shopping cart needs arenât as complicated as some, but that made me wish for a simplified setup process even more.</p>\n<p>It would be great to see these plugins take more of a âdecisions over optionsâ approach. When that isnât possible, stashing less vital options in an advanced section would lessen the initial impact of a screen full of checkboxes and dropdowns.</p></blockquote>\n<p>Ryan Imel <a href="http://wpcandy.com/teaches/how-to-build-a-micro-site-within-a-theme">explained in-depth</a> how he created the sales page for the WordPress Quarterly magazine. Within the post you&#8217;ll find his thoughts on the various e-commerce systems he tried, code snippets to produce the page, and much more. Definitely worth a read.</p>\n\n\n<p>No related posts.</p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/1yfcjdI87dw" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 01 Dec 2011 18:00:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Jeffro";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:45;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 12/1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10770";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/RfmdTwG5mL0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:883:"<h3>New plugins</h3>\n<p><a href="http://www.codepress.nl/plugins/codepress-admin-columns/"><strong>Codepress Admin Columns</strong></a> makes it easy to manage custom columns for your posts, pages, custom post types and user screens.</p>\n<p><a href="http://tempspace.net/plugins/?page_id=111"><strong>Media File Manager</strong></a> allows you make sub-directories in the upload directory, and move files into them. At the same time, this plugin modifies the URLs/path names in the database.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/email-address-encoder/"><strong>Email Address Encoder</strong></a> is a lightweight plugin to protect email addresses from email-harvesting robots by encoding them into decimal and hexadecimal entities.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/RfmdTwG5mL0" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 01 Dec 2011 14:15:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:46;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:51:"Weblog Tools Collection: WordPress 3.3 RC1 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=10772";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/TArcsl_3GMQ/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:853:"<p>The beta phase is over, and the talented folks behind <a href="http://wordpress.org/">WordPress</a> feel that 3.3 is ready for release. As with the standard process, <a href="http://wordpress.org/news/2011/12/wordpress-3-3-release-candidate-1/">the first release candidate is available</a>. If no issues are reported with this release, this may very well be what we get for WordPress 3.3, so it&#8217;s time to put your testing hats on and hammer away, especially if you&#8217;re a plugin or theme developer.</p>\n<p>If you run into any bugs, don&#8217;t forget to <a href="http://codex.wordpress.org/Reporting_Bugs">report them</a> and contact <a href="http://wordpress.org/support/forum/alphabeta">the support forum</a> if you need help.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/TArcsl_3GMQ" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 01 Dec 2011 14:00:59 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:47;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"WPTavern: 3.3 Is Getting Closer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=5921";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://feedproxy.google.com/~r/WordpressTavern/~3/Gh_H5b_rsYI/3-3-is-getting-closer";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1176:"<p>Looks quite possible that <a href="http://wordpress.org/news/2011/12/wordpress-3-3-release-candidate-1/">we&#8217;ll be using WordPress 3.3</a> before Christmas. 3.3 Beta 1 was released on October 11th so plugin and theme authors have had more than enough time to test their code against the latest version of WordPress. However, when a Release Candidate is offered, it&#8217;s generally the best time for testing as there is a very small chance that any major code changes will occur to the core. </p>\n\n\n<p>Related posts:<ol><li><a href="http://www.wptavern.com/wordpress-27-a-milestone-in-its-own-right" rel="bookmark" title="WordPress 2.7 A Milestone In Its Own Right">WordPress 2.7 A Milestone In Its Own Right</a></li>\n<li><a href="http://www.wptavern.com/wordpress-2-8-1-beta-by-end-of-the-week" rel="bookmark" title="WordPress 2.8.1 Beta By End Of The Week">WordPress 2.8.1 Beta By End Of The Week</a></li>\n<li><a href="http://www.wptavern.com/wordpress-live-user-testing" rel="bookmark" title="WordPress Live User Testing">WordPress Live User Testing</a></li>\n</ol></p><img src="http://feeds.feedburner.com/~r/WordpressTavern/~4/Gh_H5b_rsYI" height="1" width="1" />";s:7:"attribs";a