INSERT INTO `wp_posts` VALUES (19, 2, '2011-11-26 16:10:00', '2011-11-26 10:40:00', 'AdRobot is a whole new concept of introducing Andro-Humanoid robots into the field of advertising / marketing.\r\n\r\n"Interactive Advertisement!"\r\n\r\nIs your store gloomy, thanks to the same old banner system? Try AdRobot!!\r\n\r\nAdRobot senses various human movements, gestures and appropriately delivers the advertisement using speech AND a human-like motion!\r\n\r\nThis Project is still under Development.... If you are interested in it, please let us know by dropping your query at adrobot@radsinnovativesolutions.com\r\n\r\nPlease wait for further progress.', 'AdRobot', '', 'publish', 'open', 'open', '', 'adrobot', '', '', '2011-11-26 16:10:00', '2011-11-26 10:40:00', '', 0, 'http://radsinnovativesolutions.com/?page_id=19', 0, 'page', '', 0); 
