INSERT INTO `wp_posts` VALUES (30, 2, '2011-12-08 23:56:22', '2011-12-08 18:26:22', 'TrendView is the web based data-visualization software for TrendTrack.\r\n\r\n<span style="text-decoration: underline;"><strong>A Screenshot of TrendView :</strong></span>\r\n\r\n[caption id="attachment_42" align="alignnone" width="580" caption="TrendView - Screenshot"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/scr1.png"><img class="size-full wp-image-42 " title="Screen Shot" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/scr1.png" alt="TrendView" width="580" height="346" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\nTrendView offers the following features :\r\n\r\n&nbsp;\r\n\r\n<strong>Â»A time based comparative graph to the left</strong>\r\n\r\n[caption id="attachment_43" align="alignnone" width="300" caption="Time Based Graph"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f1.png"><img class="size-medium wp-image-43" title="Feature-1" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f1-300x227.png" alt="Time Based Graph" width="300" height="227" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\n<strong>Â»Total of the graph in a pie chart to the right</strong>\r\n\r\n[caption id="attachment_45" align="alignnone" width="225" caption="Pie Chart of Totals"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f2.png"><img class="size-full wp-image-45" title="Feature 2" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f2.png" alt="Pie Chart of Totals" width="225" height="220" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\n<strong>Â»Selection of different periods of interest</strong>\r\n\r\n[caption id="attachment_46" align="alignnone" width="300" caption="Selection of Period of Interest"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f7.png"><img class="size-medium wp-image-46" title="Feature 3" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f7-300x109.png" alt="Selection of Period of Interest" width="300" height="109" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\n<strong>Â»Categorization based on Gender, Age and both</strong>\r\n\r\n[caption id="attachment_47" align="alignnone" width="300" caption="Categorization - Total"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f3.png"><img class="size-medium wp-image-47" title="Feature 4" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f3-300x181.png" alt="Categorization - Total" width="300" height="181" /></a>[/caption]\r\n\r\n[caption id="attachment_48" align="alignnone" width="300" caption="Categorization - Gender Based"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f4.png"><img class="size-medium wp-image-48" title="Feature 4" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f4-300x188.png" alt="Categorization - Gender Based" width="300" height="188" /></a>[/caption]\r\n\r\n[caption id="attachment_49" align="alignnone" width="300" caption="Categorization - Age Based"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f5.png"><img class="size-medium wp-image-49" title="Feature 4" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f5-300x190.png" alt="Categorization - Age Based" width="300" height="190" /></a>[/caption]\r\n\r\n[caption id="attachment_50" align="alignnone" width="300" caption="Categorization - Age &amp; Gender Based"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f6.png"><img class="size-medium wp-image-50" title="Feature 4" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f6-300x186.png" alt="Categorization - Age &amp; Gender Based" width="300" height="186" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\n<strong>Â»Choose a store of interest</strong>\r\n\r\n[caption id="attachment_55" align="alignnone" width="300" caption="Choose a store"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f9.png"><img class="size-medium wp-image-55" title="Feature 5" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f9-300x119.png" alt="Choose a store" width="300" height="119" /></a>[/caption]\r\n\r\n&nbsp;\r\n\r\n<strong>Â»Exporting the data into ME Excel format for further analysis/records.</strong>\r\n\r\n[caption id="attachment_51" align="alignnone" width="300" caption="Export Data to MS Excel"]<a href="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f8.png"><img class="size-medium wp-image-51" title="Feature 6" src="http://radsinnovativesolutions.com/wp-content/uploads/2011/12/f8-300x129.png" alt="Export Data to MS Excel" width="300" height="129" /></a>[/caption]\r\n\r\n<span style="color: #ff9900;">Â </span>\r\n\r\n<span style="color: #ff9900;">Existing Users</span> :Â <a title="TrendView" href="http://radsinnovativesolutions.com/TrendView.php" target="_blank">Click here to Login</a>\r\n\r\nNew Registrations are closed - i.e on a request basis only. Please send an e-mail to trendtrack@radsinnovativesolutions.com for further information.', 'TrendView', '', 'publish', 'open', 'open', '', 'trendview', '', '', '2011-12-08 23:56:22', '2011-12-08 18:26:22', '', 6, 'http://radsinnovativesolutions.com/?page_id=30', 0, 'page', '', 0); 
