INSERT INTO `wp_posts` VALUES (62, 2, '2011-12-08 23:59:58', '2011-12-08 18:29:58', 'AdRobot is a whole new concept of introducing Andro-Humanoid robots into the field of advertising / marketing.\r\n\r\nâInteractive Advertisement!â\r\n\r\nIs your store gloomy, thanks to the same old banner system? Try AdRobot!!\r\n\r\nAdRobot senses various human movements, gestures and appropriately delivers the advertisement using speech AND a human-like motion!\r\n\r\nThis Project is still under Developmentâ¦. If you are interested in it, please let us know by dropping your query at adrobot@radsinnovativesolutions.com\r\n\r\nPlease wait for further progress.', '', '', 'publish', 'open', 'open', '', '62', '', '', '2011-12-09 00:09:07', '2011-12-08 18:39:07', '', 0, 'http://radsinnovativesolutions.com/?p=62', 1, 'nav_menu_item', '', 0); 
